import React, { Component } from 'react';
import Image from '../modules/Gallery-image';
import List from './.newFolder/CustomComponents/CustomCardList';

interface showFavProps {
    images: Image[];
    onDelete: (item: Image) =>void;
    onEdit: (item: Image) =>void;
    options: {
        onFav: (item: Image) => void;
    };
}

export default class ShowFav extends Component<showFavProps,{}> {
  render() {
    return (
        <List<Image> onDelete={this.handleDeleteImage} onEdit={this.handleEdit} options={{ onFav: this.handleFav }} items={this.state.images.filter(img => img.isFav)} Card={ImageCard as unknown as ComponentType<Image>}  />
    )
  }
}
